/*
 * @lc app=leetcode id=2486 lang=cpp
 *
 * [2486] Append Characters to String to Make Subsequence
 *
 * https://leetcode.com/problems/append-characters-to-string-to-make-subsequence/description/
 *
 * algorithms
 * Medium (65.64%)
 * Likes:    611
 * Dislikes: 38
 * Total Accepted:    67.7K
 * Total Submissions: 95K
 * Testcase Example:  '"coaching"\n"coding"'
 *
 * You are given two strings s and t consisting of only lowercase English
 * letters.
 *
 * Return the minimum number of characters that need to be appended to the end
 * of s so that t becomes a subsequence of s.
 *
 * A subsequence is a string that can be derived from another string by
 * deleting some or no characters without changing the order of the remaining
 * characters.
 *
 *
 * Example 1:
 *
 *
 * Input: s = "coaching", t = "coding"
 * Output: 4
 * Explanation: Append the characters "ding" to the end of s so that s =
 * "coachingding".
 * Now, t is a subsequence of s ("coachingding").
 * It can be shown that appending any 3 characters to the end of s will never
 * make t a subsequence.
 *
 *
 * Example 2:
 *
 *
 * Input: s = "abcde", t = "a"
 * Output: 0
 * Explanation: t is already a subsequence of s ("abcde").
 *
 *
 * Example 3:
 *
 *
 * Input: s = "z", t = "abcde"
 * Output: 5
 * Explanation: Append the characters "abcde" to the end of s so that s =
 * "zabcde".
 * Now, t is a subsequence of s ("zabcde").
 * It can be shown that appending any 4 characters to the end of s will never
 * make t a subsequence.
 *
 *
 *
 * Constraints:
 *
 *
 * 1 <= s.length, t.length <= 10^5
 * s and t consist only of lowercase English letters.
 *
 *
 */
#include <bits/stdc++.h>
using namespace std;
// @lc code=start
class Solution
{
public:
    int appendCharacters(string s, string t)
    {
        int s_len = (int) s.size();
        int t_len = (int) t.size();
        // The subsequence index of s
        int t_idx = 0, s_idx = 0;
        while (s_idx < s_len && t_idx < t_len)
        {
            if (s[s_idx] == t[t_idx])
            {
                t_idx++;
            }
            s_idx++;
        }
        return t_len - t_idx;
    }
};
// @lc code=end
int main(int argc, char** argv)
{
    Solution sol;
    // Test_1
    string s_1      = "coaching";
    string t_1      = "coding";
    int    result_1 = sol.appendCharacters(s_1, t_1);
    cout << result_1 << endl;
    assert(result_1 == 4);

    // Test_2
    string s_2      = "abcde";
    string t_2      = "a";
    int    result_2 = sol.appendCharacters(s_2, t_2);
    cout << result_2 << endl;
    assert(result_2 == 0);

    // Test_3
    string s_3      = "z";
    string t_3      = "abcde";
    int    result_3 = sol.appendCharacters(s_3, t_3);
    cout << result_3 << endl;
    assert(result_3 == 5);

    // Test_4
    string s_4
        = "";
    string t_4
        = "";
    int result_4 = sol.appendCharacters(s_4, t_4);
    cout << result_4 << endl;
    assert(result_4 == 96063);

    return 0;
}
